import React from 'react';
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';
import './App.css';
import Home from './Home';
import Login from './Login'; // import Login component

function App() {
  return (
    <Router>
      <div className="app">
        <header className="header">
          <h1><Link to="/">Home</Link></h1> {/* Use Link for navigation */}
          <Link to="/login" className="login-button">Login</Link> {/* Use Link for navigation */}
        </header>
        <div className="main-content">
          <main className="content">
            <Switch>
              <Route path="/login"> {/* Route for Login component */}
                <Login />
              </Route>
              <Route path="/"> {/* Route for Home component */}
                <Home />
              </Route>
            </Switch>
          </main>
        </div>
        <footer className="footer">
          <p>CS369 Group Project</p>
        </footer>
      </div>
    </Router>
  );
}

export default App;
